import React from "react";

const LoginPage = () => {
  return (
    <div style={styles.container}>
      <div style={styles.loginBox}>
        <h2 style={styles.title}>LOGIN INTO YOUR ACCOUNT</h2>
        <p style={styles.subText}>Login in using SN</p>
        <div style={styles.socialIcons}>
          <span style={styles.socialButton}>F</span>
          <span style={styles.socialButton}>G</span>
          <span style={styles.socialButton}>in</span>
        </div>
        <p style={styles.orText}>OR</p>
        <input type="email" placeholder="Email" style={styles.input} />
        <div style={styles.passwordContainer}>
          <input type="password" placeholder="Password" style={styles.passwordInput} />
          <span style={styles.eyeIcon}>üëÅÔ∏è</span>
        </div>
        <button style={styles.signInButton}>SIGN IN</button>
      </div>

      <div style={styles.signupBox}>
        <h2 style={styles.signupTitle}>New Here?</h2>
        <p style={styles.signupText}>Sign up and discover a great amount of educational events!</p>
        <button style={styles.signupButton}>Sign Up</button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    height: "100vh",
    padding: "20px",
    fontFamily: "'Arial', sans-serif",
    background: "#FCD0A1", // Light peach from palette
  },
  loginBox: {
    flex: 1,
    padding: "40px",
    maxWidth: "400px",
    background: "#B1B695", // Soft greenish-gray
    borderRadius: "10px",
    textAlign: "center",
    boxShadow: "2px 4px 10px rgba(0,0,0,0.1)",
  },
  title: {
    fontSize: "22px",
    fontWeight: "bold",
    color: "#6D1A36", // Dark maroon from palette
  },
  subText: {
    fontSize: "14px",
    color: "#333",
  },
  socialIcons: {
    display: "flex",
    justifyContent: "center",
    gap: "10px",
    marginBottom: "10px",
  },
  socialButton: {
    background: "#53917E", // Teal green
    color: "white",
    padding: "8px 12px",
    borderRadius: "5px",
    cursor: "pointer",
  },
  orText: {
    margin: "10px 0",
    color: "#333",
  },
  input: {
    width: "100%",
    padding: "10px",
    margin: "8px 0",
    borderRadius: "5px",
    border: "1px solid #63535B", // Grayish tone from palette
  },
  passwordContainer: {
    position: "relative",
  },
  passwordInput: {
    width: "100%",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #63535B",
  },
  eyeIcon: {
    position: "absolute",
    right: "10px",
    top: "50%",
    transform: "translateY(-50%)",
    cursor: "pointer",
  },
  signInButton: {
    width: "100%",
    padding: "12px",
    marginTop: "10px",
    background: "#53917E",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "bold",
  },
  signupBox: {
    flex: 1,
    padding: "40px",
    maxWidth: "400px",
    background: "#53917E", // Teal green
    borderRadius: "10px",
    textAlign: "center",
    color: "white",
    boxShadow: "2px 4px 10px rgba(0,0,0,0.1)",
  },
  signupTitle: {
    fontSize: "22px",
    fontWeight: "bold",
  },
  signupText: {
    fontSize: "14px",
    marginBottom: "15px",
  },
  signupButton: {
    background: "#6D1A36", // Maroon
    color: "white",
    padding: "10px 20px",
    borderRadius: "5px",
    border: "none",
    cursor: "pointer",
  },
};

export default LoginPage;
